let teamButton=document.getElementById('team-button');teamButton.onclick=()=>{document.getElementById('team').scrollIntoView({behavior:'smooth',block:'start'})}
let newsButton=document.getElementById('news-button');newsButton.onclick=()=>{document.getElementById('news').scrollIntoView({behavior:'smooth',block:'center'})}
let contactButton=document.getElementById('contact-button');contactButton.onclick=()=>{document.getElementById('contact').scrollIntoView({behavior:'smooth',block:'center'})}
var contactAlert=document.getElementById('contact').getElementsByClassName('alert')[0];if(contactAlert){setTimeout(()=>{let containerAlert=document.querySelector('#contact article.w-75.mx-auto');containerAlert.removeChild(containerAlert.getElementsByClassName('alert')[0])},10000)}